import React, { Component } from "react";
import axios from "axios";
import { useEffect, useState } from "react";
function CentersTest() {
  const [centers, setCenters] = useState([]);
  useEffect(() => {
    axios
      .get("https://localhost:44303/api/centers")
      .then((res) => {
        console.log(res);
        setCenters(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  {
    return (
      <React.Fragment>
        <h1>My profile:</h1>
        <ul>
          centers.map(center => <li key={center.id}>{center.id}</li>)
        </ul>
      </React.Fragment>
    );
  }
}

export default CentersTest;
